INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 7, "2015/12/17 15:00:00", -363.0, 0, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 7001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 7, "2015/12/17 15:00:00", -363.0, 0, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 7002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 7, "2015/12/17 15:00:00", -363.0, 0, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 7003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 10, "2015/12/17 15:00:00", -363.0, 0, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 10001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 10, "2015/12/17 15:00:00", -363.0, 0, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 10002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 10, "2015/12/17 15:00:00", -363.0, 0, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 10003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 10, "2015/12/17 15:00:00", -363.0, 2104010, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 10004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 12, "2015/12/17 15:00:00", -416.5, 0, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 12001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 13, "2015/12/17 15:00:00", -363.0, 0, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 13001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 13, "2015/12/17 15:00:00", -363.0, 0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 13002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 13, "2015/12/17 15:00:00", -363.0, 2104010, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 13003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 13, "2015/12/17 15:00:00", -363.0, 0, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 13004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 14, "2015/12/17 15:00:00", -363.0, 0, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 14001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 14, "2015/12/17 15:00:00", -363.0, 2104010, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 14002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 14, "2015/12/17 15:00:00", -363.0, 0, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 14003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 14, "2015/12/17 15:00:00", -363.0, 0, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 14004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 15, "2015/12/17 15:00:00", -470.0, 0, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 15001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 16, "2015/12/17 15:00:00", -363.0, 2104010, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 16001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 16, "2015/12/17 15:00:00", -363.0, 0, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 16002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 16, "2015/12/17 15:00:00", -363.0, 0, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 16003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 16, "2015/12/17 15:00:00", -363.0, 0, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 16004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 17, "2015/12/17 15:00:00", -363.0, 0, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 17002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 25, "2015/12/17 15:00:00", -363.0, 0, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 17004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 25, "2015/12/17 15:00:00", -363.0, 0, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 17005, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 25, "2015/12/17 15:00:00", -363.0, 2104010, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 17006, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 25, "2015/12/17 15:00:00", -363.0, 0, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 17007, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 18, "2015/12/17 15:00:00", -363.0, 0, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", "2030/12/17 14:59:59", 1, 190801, 1, 0, 0.0, 18001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 18, "2015/12/17 15:00:00", -363.0, 0, "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", "2030/12/17 14:59:59", 2, 190801, 1, 0, 0.0, 18002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 19, "2015/12/17 15:00:00", -470.0, 0, "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", "2030/12/17 14:59:59", 3, 190801, 1, 0, 0.0, 19001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 19, "2015/12/17 15:00:00", -470.0, 0, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", "2030/12/17 14:59:59", 4, 190801, 1, 0, 0.0, 19002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 20, "2015/12/17 15:00:00", -470.0, 0, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", "2030/12/17 14:59:59", 5, 190801, 1, 0, 0.0, 20001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 20, "2015/12/17 15:00:00", -470.0, 0, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", "2030/12/17 14:59:59", 6, 190801, 1, 0, 0.0, 20002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 21, "2015/12/17 15:00:00", -363.0, 0, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 21001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 21, "2015/12/17 15:00:00", -363.0, 0, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 21002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 21, "2015/12/17 15:00:00", -363.0, 2104010, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 21003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 21, "2015/12/17 15:00:00", -363.0, 0, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 21004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 22, "2015/12/17 15:00:00", -430.0, 0, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", "2030/12/17 14:59:59", 1, 190801, 1, 0, 0.0, 22001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 22, "2015/12/17 15:00:00", -430.0, 0, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", "2030/12/17 14:59:59", 2, 190801, 1, 0, 0.0, 22002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 23, "2015/12/17 15:00:00", -430.0, 0, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", "2030/12/17 14:59:59", 3, 190801, 1, 0, 0.0, 23001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 23, "2015/12/17 15:00:00", -430.0, 0, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", "2030/12/17 14:59:59", 4, 190801, 1, 0, 0.0, 23002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", -385.0, 0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "2030/12/17 14:59:59", 1, 109001, 2, 10011, 8.0, 24001, 4.08);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", -385.0, 0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "2030/12/17 14:59:59", 2, 109001, 2, 10011, 8.0, 24002, 5.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", -385.0, 0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "2030/12/17 14:59:59", 3, 109001, 2, 10011, 8.0, 24003, 10.11);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", -385.0, 0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "2030/12/17 14:59:59", 4, 109001, 2, 10011, 8.0, 24004, 4.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", -385.0, 0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "2030/12/17 14:59:59", 5, 109001, 2, 10011, 8.0, 24005, 6.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "2030/12/17 14:59:59", 6, 109002, 1, 10011, 0.0, 24006, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "2030/12/17 14:59:59", 7, 109002, 1, 10011, 0.0, 24007, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "2030/12/17 14:59:59", 8, 109002, 1, 10011, 0.0, 24008, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "2030/12/17 14:59:59", 9, 109002, 1, 10011, 0.0, 24009, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("エリコ（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "2030/12/17 14:59:59", 10, 109002, 1, 10011, 0.0, 24010, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 1, 24, "2019/01/31 12:00:00", -385.0, 0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "2030/12/17 14:59:59", 1, 109101, 2, 10011, 8.0, 24011, 2.12);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 5, 24, "2019/01/31 12:00:00", -385.0, 0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "2030/12/17 14:59:59", 2, 109101, 2, 10011, 8.0, 24012, 4.19);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 2, 24, "2019/01/31 12:00:00", -385.0, 0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "2030/12/17 14:59:59", 3, 109101, 4, 10011, 8.0, 24013, 2.3);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "2030/12/17 14:59:59", 4, 109102, 1, 10011, 0.0, 24014, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 5, 24, "2019/01/31 12:00:00", -385.0, 0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "2030/12/17 14:59:59", 5, 109101, 2, 10011, 8.0, 24015, 5.23);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "2030/12/17 14:59:59", 6, 109102, 1, 10011, 0.0, 24016, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 1, 24, "2019/01/31 12:00:00", -385.0, 0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "2030/12/17 14:59:59", 7, 109101, 2, 10011, 8.0, 24017, 5.01);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "2030/12/17 14:59:59", 8, 109102, 1, 10011, 0.0, 24018, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "2030/12/17 14:59:59", 9, 109102, 1, 10011, 0.0, 24019, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シズル（バレンタイン）", 1, 24, "2019/01/31 12:00:00", 0.0, 0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "2030/12/17 14:59:59", 10, 109102, 1, 10011, 0.0, 24020, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 26, "2015/12/17 15:00:00", -363.0, 2104010, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 26001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 26, "2015/12/17 15:00:00", -363.0, 0, "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 26002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 26, "2015/12/17 15:00:00", -363.0, 0, "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 26003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 26, "2015/12/17 15:00:00", -363.0, 0, "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 26004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 2, 27, "2015/12/17 15:00:00", -363.0, 2104010, "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 27001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 27, "2015/12/17 15:00:00", -363.0, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 27002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 27, "2015/12/17 15:00:00", -363.0, 0, "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 27003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 27, "2015/12/17 15:00:00", -363.0, 0, "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 27004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 28, "2019/09/24 15:00:00", -363.0, 0, "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！", "2030/12/17 14:59:59", 1, 190801, 1, 0, 0.0, 28001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 28, "2019/09/24 15:00:00", -363.0, 0, "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください", "2030/12/17 14:59:59", 2, 190801, 1, 0, 0.0, 28002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 29, "2019/09/24 15:00:00", -409.0, 0, "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！", "2030/12/17 14:59:59", 3, 190801, 1, 0, 0.0, 29001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 29, "2019/09/24 15:00:00", -409.0, 0, "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ", "2030/12/17 14:59:59", 4, 190801, 1, 0, 0.0, 29002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 30, "2019/09/24 15:00:00", -409.0, 0, "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！", "2030/12/17 14:59:59", 5, 190801, 1, 0, 0.0, 30001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 30, "2019/09/24 15:00:00", -409.0, 0, "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！", "2030/12/17 14:59:59", 6, 190801, 1, 0, 0.0, 30002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 31, "2019/10/31 12:00:00", -409.0, 0, "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！", "2030/12/17 14:59:59", 7, 190801, 1, 0, 0.0, 31001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 31, "2019/10/31 12:00:00", -409.0, 0, "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね", "2030/12/17 14:59:59", 8, 190801, 1, 0, 0.0, 31002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 32, "2019/12/20 5:00:00", -409.0, 0, "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！", "2020/01/04 4:59:59", 1, 190801, 1, 0, 0.0, 32001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 32, "2019/12/20 5:00:00", -409.0, 0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2020/01/04 4:59:59", 2, 190801, 1, 0, 0.0, 32002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 33, "2019/12/20 5:00:00", -409.0, 0, "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！", "2020/01/04 4:59:59", 3, 190801, 1, 0, 0.0, 33001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 33, "2019/12/20 5:00:00", -409.0, 0, "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！", "2020/01/04 4:59:59", 4, 190801, 1, 0, 0.0, 33002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 34, "2020/01/04 5:00:00", -409.0, 0, "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！", "2020/01/10 11:59:59", 5, 190801, 1, 0, 0.0, 34001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 34, "2020/01/04 5:00:00", -409.0, 0, "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！", "2020/01/10 11:59:59", 6, 190801, 1, 0, 0.0, 34002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 38, "2015/12/17 15:00:00", -458.0, 0, "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪", "2030/12/17 14:59:59", 1, 105801, 2, 0, 0.0, 38001, 5.3);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 38, "2015/12/17 15:00:00", -458.0, 0, "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆", "2030/12/17 14:59:59", 2, 105801, 2, 0, 0.0, 38002, 6.5);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 3, 39, "2020/04/01", 9999.0, 0, "", "2020/04/08 23:59:59", 0, 105801, 3, 0, 9999.0, 39005, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("カリン", 1, 40, "2015/12/17 15:00:00", -430.0, 0, "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪", "2030/12/17 14:59:59", 2, 190801, 1, 0, 0.0, 40001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 1, 41, "2015/12/17 15:00:00", -363.0, 2104010, "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 41001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 41, "2015/12/17 15:00:00", -363.0, 0, "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 41002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 41, "2015/12/17 15:00:00", -363.0, 0, "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 41003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 41, "2015/12/17 15:00:00", -363.0, 0, "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 41004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 42, "2015/12/17 15:00:00", -416.5, 0, "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 42001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("シェフィ", 1, 42, "2015/12/17 15:00:00", -416.5, 2104010, "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。", "2030/12/17 14:59:59", 1, 106401, 1, 0, 0.0, 42002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 42, "2015/12/17 15:00:00", -416.5, 0, "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 42003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 42, "2015/12/17 15:00:00", -416.5, 0, "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 42004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("ペコリーヌ", 1, 43, "2015/12/17 15:00:00", -363.0, 0, "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！", "2030/12/17 14:59:59", 1, 105801, 1, 0, 0.0, 43001, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("コッコロ", 1, 43, "2015/12/17 15:00:00", -363.0, 0, "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", "2030/12/17 14:59:59", 1, 105901, 1, 0, 0.0, 43002, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("キャル", 1, 43, "2015/12/17 15:00:00", -363.0, 0, "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", "2030/12/17 14:59:59", 1, 106001, 1, 0, 0.0, 43003, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("アメス", 1, 44, "2015/12/17 15:00:00", -416.5, 0, "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪", "2030/12/17 14:59:59", 1, 123001, 1, 0, 0.0, 43004, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("アメス", 1, 44, "2015/12/17 15:00:00", -416.5, 0, "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", "2030/12/17 14:59:59", 2, 123001, 1, 0, 0.0, 43005, 0.0);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("アメス", 1, 45, "2015/12/17 15:00:00", -416.5, 0, "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", "2030/12/17 14:59:59", 3, 123001, 2, 0, 0.0, 43006, 5.79);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES ("アメス", 1, 46, "2015/12/17 15:00:00", -371.5, 0, "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", "2030/12/17 14:59:59", 1, 123001, 1, 0, 0.0, 46001, 0.0);
